        <div className="videoHorizontal_channel d-flex align-items-centermy-1">
          {/* <LazyLoadImage
            src="https://www.seoclerk.com/pics/319222-1IvI0s1421931178.png"
            effect="blur"
          /> */}
          <p>Backbench Coder</p>
        </div>
      </Col>
    </Row>
  );
};

export default VideoHorizontal;
